import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Импорт стилей

const Navbar = () => {
  return (
    <nav>
      <ul className="navbar-menu">
        <li><Link to="/" className="navbar-link">Home</Link></li>
        <li><Link to="/planets" className="navbar-link">Planets</Link></li>
        <li><Link to="/characters" className="navbar-link">Characters</Link></li>
        <li><Link to="/starships" className="navbar-link">Starships</Link></li>
      </ul>
      <p className="navbar-text">Hello it is star wars</p>
    </nav>
  );
};

export default Navbar;
